        "text": "94\npappardelle with cavolo\nnero, chilli & hazelnuts\nONE OF MY FAVOURITE DISHES is pasta tossed with garlic, chilli,\nparsley, olive oil and orange zest. I've simply added cabbage and\nnuts here to make it a bit healthier (and quite a lot more delicious).\nSERVES 4\n400g (140z) pappardelle\nsalt and pepper\n700g (ilb 9oz) cavolo nero\n5 tbsp extra virgin olive oil, plus more to serve\n3 garlic cloves, finely sliced\n2 red chillies, deseeded and chopped, or about 1/2 tsp chilli flakes\nfinely grated zest of 1/ large orange\n40g (11/20z) hazelnuts, halved and toasted (see page 281)\n25g (scant 10z) flat leaf parsley leaves, roughly chopped\nfinely grated Parmesan cheese, to serve\nPut the pasta in a large pan of boiling salted water and cook until al dente, about 15 minuten\nor a minute or so less than suggested on the packet instructions. Meanwhile, remor\nribs from the cavolo nero (discard them) and wash the leaves. Plunge into bomga\ncook for seven minutes. Drain well. Squeeze the excess water from the cabbag\"\nand chop it roughly.\nabbage with your hands\nWhen the pasta has about four minutes left to cook, heat the oil and gently saute\nchillies until the garlic is pale gold. Add the zest and cabbage, season\nand gently saut√© the garlic and\ncabbage, season well and heat through.\nDrain the pasta, return it to its pan and add the hazelnuts and the conte\nSeason and add the parsley. Drizzle with more olive oil. Serve with grated\nS and the contents of the cabbage pan.\nwith grated Parmesan cheese.\n"
